angular.module('app').run(['$templateCache', function($templateCache) {$templateCache.put('components/weatherComponent/weather.tpl.html','<div class="container"><div class="row"><div class="col-2"><item city-data="cityData" ng-repeat="cityData in $ctrl.citiesData" ng-click="$ctrl.getWeatherForecast(cityData.data.name)" ng-class="{active: $ctrl.selectedCity === cityData.data.name}"></item></div><div class="col-10 dashboard-wrapper"><dashboard weather-data="$ctrl.result" city="$ctrl.selectedCity"></dashboard></div></div></div>');
$templateCache.put('components/weatherComponent/components/dashboard/dashboard.tpl.html','<h2>{{$ctrl.city}}</h2><div ng-repeat="data in $ctrl.weatherData.list"><row input-data="data" prev-date="$ctrl.weatherData.list[$index-1].dt"></row></div>');
$templateCache.put('components/weatherComponent/components/dashboard/components/row/row.tpl.html','<div class="row" ng-if="$ctrl.showDate"><div class="col"><p class="date">{{$ctrl.currentDate | date: \'yyyy-MM-dd\'}}</p></div></div><div class="row"><div class="col-2"><span class="time">{{$ctrl.currentDate | date: \'HH:mm\'}}</span></div><div class="col-10"><p>{{$ctrl.inputData.main.temp_min}} - {{$ctrl.inputData.main.temp_max}} C</p><span>Humidity: {{$ctrl.inputData.main.humidity}}</span> <span>Wind: {{$ctrl.inputData.wind.speed}} m/s</span> <span>Clouds: {{$ctrl.inputData.clouds.all}} %</span> <span>Weather: {{$ctrl.inputData.weather[0].description}}</span></div></div>');}]);